    <g transform="matrix(1, 0, 0, 1, 114.073242, 80.60984)"><text font-family="微軟正黑體" font-style="normal" font-weight="normal" font-stretch="normal" font-size="13.5pt" fill="#000000" x="0" y="61.05437"><tspan x="0" y="17.85437" textLength="324">这期咱们来探讨一下公式定义器的使用以</tspan><tspan x="0" y="39.45437" textLength="90">及它的扩展</tspan><tspan x="90" y="39.45437" textLength="18" font-family="Malgun Gothic" font-stretch="normal">。</tspan><tspan x="108" y="39.45437" textLength="180">在此之前我想问个问题</tspan><tspan x="288" y="39.45437" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="306" y="39.45437" textLength="18">你</tspan><tspan x="0" y="61.05437" textLength="306">知道在什么地方会使用到公式定义器吗</tspan><tspan x="306" y="61.05437" textLength="18" font-family="Malgun Gothic" font-stretch="normal">？</tspan></text></g>
    <g transform="matrix(1, 0, 0, 1, 258.934631, 256.8599)"><text font-family="微軟正黑體" font-style="normal" font-weight="normal" font-stretch="normal" font-size="13.5pt" fill="#000000" x="0" y="61.05437"><tspan x="0" y="17.85437" textLength="90">据我的了解</tspan><tspan x="90" y="17.85437" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="108" y="17.85437" textLength="252">公式定义器主要用于自定义表单</tspan><tspan x="0" y="39.45437" textLength="108">控件的初始值</tspan><tspan x="108" y="39.45437" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="126" y="39.45437" textLength="144">审批节点的审批人</tspan><tspan x="270" y="39.45437" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="288" y="39.45437" textLength="72">自动分支</tspan><tspan x="0" y="61.05437" textLength="162">的条件表达式等地方</tspan><tspan x="162" y="61.05437" textLength="18" font-family="Malgun Gothic" font-stretch="normal">。</tspan></text></g>

    <g transform="matrix(1, 0, 0, 1, 414.741577, 50.2930679)"><text font-family="微軟正黑體" font-style="normal" font-weight="normal" font-stretch="normal" font-size="13.5pt" fill="#000000" x="0" y="17.64343"><tspan x="0" y="17.64343" textLength="36">没错</tspan><tspan x="36" y="17.64343" textLength="18" font-family="Malgun Gothic" font-stretch="normal">！</tspan></text></g>
    <g transform="matrix(1, 0, 0, 1, 102.823151, 140.2938)"><text font-family="微軟正黑體" font-style="normal" font-weight="normal" font-stretch="normal" font-size="13.5pt" fill="#000000" x="0" y="212.9926"><tspan x="0" y="18.59264" textLength="234">公式定义器的有以下几个特点</tspan><tspan x="234" y="18.59264" textLength="18" font-family="Malgun Gothic" font-stretch="normal">：</tspan><tspan x="0" y="40.19264" font-family="Arial" font-stretch="normal">1</tspan><tspan x="10" y="40.19264" textLength="18" font-family="Malgun Gothic" font-stretch="normal">、</tspan><tspan x="28" y="40.19264" textLength="126">具有运行上下文</tspan><tspan x="154" y="40.19264" textLength="18" font-family="Malgun Gothic" font-stretch="normal">。</tspan><tspan x="172" y="40.19264" textLength="72">简单地说</tspan><tspan x="244" y="40.19264" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="262" y="40.19264" textLength="36">就是</tspan><tspan x="298" y="40.19264" textLength="36" font-weight="bold">变量</tspan><tspan x="334" y="40.19264" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="352" y="40.19264" textLength="126">参与计算的数据</tspan><tspan x="478" y="40.19264" textLength="18" font-family="Malgun Gothic" font-stretch="normal">。</tspan><tspan x="496" y="40.19264" textLength="18">如</tspan><tspan x="514" y="40.19264" textLength="18" font-family="Malgun Gothic" font-stretch="normal">：</tspan><tspan x="0" y="61.79264" textLength="16" font-family="Arial" font-stretch="normal">“$</tspan><tspan x="16" y="61.79264" textLength="72">报销金额</tspan><tspan x="88" y="61.79264" textLength="16" font-family="Arial" font-stretch="normal">$”</tspan><tspan x="104" y="61.79264" textLength="18" font-family="Malgun Gothic" font-stretch="normal">。</tspan><tspan x="0" y="83.39265" font-family="Arial" font-stretch="normal">2</tspan><tspan x="10" y="83.39265" textLength="18" font-family="Malgun Gothic" font-stretch="normal">、</tspan><tspan x="28" y="83.39265" textLength="72">通过一些</tspan><tspan x="100" y="83.39265" textLength="90" font-weight="bold">逻辑运算符</tspan><tspan x="190" y="83.39265" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="208" y="83.39265" textLength="144">进行一系列的运算</tspan><tspan x="352" y="83.39265" textLength="18" font-family="Malgun Gothic" font-stretch="normal">。</tspan><tspan x="370" y="83.39265" textLength="144">对于相对复杂的运</tspan><tspan x="0" y="104.9927" textLength="18">算</tspan><tspan x="18" y="104.9927" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="36" y="104.9927" textLength="54">引入了</tspan><tspan x="90" y="104.9927" textLength="36" font-weight="bold">函数</tspan><tspan x="126" y="104.9927" textLength="54">的概念</tspan><tspan x="180" y="104.9927" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="198" y="104.9927" textLength="144">方便了公式的编写</tspan><tspan x="342" y="104.9927" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="360" y="104.9927" textLength="18">如</tspan><tspan x="378" y="104.9927" textLength="18" font-family="Malgun Gothic" font-stretch="normal">：</tspan><tspan x="396" y="104.9927" textLength="16" font-family="Arial" font-stretch="normal">“$</tspan><tspan x="412" y="104.9927" textLength="36">时间</tspan><tspan x="448" y="104.9927" textLength="5" font-family="Arial" font-stretch="normal">.</tspan><tspan x="453" y="104.9927" textLength="72">获取时间</tspan><tspan x="0" y="126.5927" textLength="18">差</tspan><tspan x="18" y="126.5927" textLength="26" font-family="Arial" font-stretch="normal">$($</tspan><tspan x="44" y="126.5927" textLength="72">结束时间</tspan><tspan x="116" y="126.5927" textLength="30" font-family="Arial" font-stretch="normal">$, $</tspan><tspan x="146" y="126.5927" textLength="72">开始时间</tspan><tspan x="218" y="126.5927" textLength="22" font-family="Arial" font-stretch="normal">$)”</tspan><tspan x="240" y="126.5927" textLength="18" font-family="Malgun Gothic" font-stretch="normal">。</tspan><tspan x="0" y="148.1927" font-family="Arial" font-stretch="normal">3</tspan><tspan x="10" y="148.1927" textLength="18" font-family="Malgun Gothic" font-stretch="normal">、</tspan><tspan x="28" y="148.1927" textLength="126">最终会返回一个</tspan><tspan x="154" y="148.1927" textLength="36" font-weight="bold">结果</tspan><tspan x="190" y="148.1927" textLength="18" font-family="Malgun Gothic" font-stretch="normal">。</tspan><tspan x="0" y="169.7926" textLength="324">但是公式定义器中所有变量都有数据类型</tspan><tspan x="324" y="169.7926" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="342" y="169.7926" textLength="180">函数中的输入输出也有</tspan><tspan x="0" y="191.3926" textLength="72">数据类型</tspan><tspan x="72" y="191.3926" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="90" y="191.3926" textLength="270">公式定义的返回结果也有数据类型</tspan><tspan x="360" y="191.3926" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="378" y="191.3926" textLength="144">那如何确认一个变</tspan><tspan x="0" y="212.9926" textLength="126">量的数据类型呢</tspan><tspan x="126" y="212.9926" textLength="18" font-family="Malgun Gothic" font-stretch="normal">？</tspan></text></g>

    <g transform="matrix(1, 0, 0, 1, 114.073242, 74.98481)"><text font-family="微軟正黑體" font-style="normal" font-weight="normal" font-stretch="normal" font-size="13.5pt" fill="#000000" x="0" y="104.4653"><tspan x="0" y="18.06531" textLength="324">我只知道系统预定义的字段来自系统的数</tspan><tspan x="0" y="39.66531" textLength="54">据字典</tspan><tspan x="54" y="39.66531" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="72" y="39.66531" textLength="252">数据类型开发人员应该非常清楚</tspan><tspan x="324" y="39.66531" textLength="18" font-family="Malgun Gothic" font-stretch="normal">；</tspan><tspan x="0" y="61.26531" textLength="288">但是自定义表单的字段类型如何确定</tspan><tspan x="288" y="61.26531" textLength="18" font-family="Malgun Gothic" font-stretch="normal">，</tspan><tspan x="306" y="61.26531" textLength="18">以</tspan><tspan x="0" y="82.86532" textLength="324">及公式定义器中函数的参数类型和返回值</tspan><tspan x="0" y="104.4653" textLength="234">类型如何确定我就不太清楚啦</tspan><tspan x="234" y="104.4653" textLength="18" font-family="Malgun Gothic" font-stretch="normal">！</tspan></text></g>
